import React from 'react';
import { Switch, Route, Navigate } from 'react-router-dom';
import ProfileSetup from "./routes/ProfileSetup";
//import HomePage from './Home';

const PrivateRoute = () => {

  return (
    <Routes>
      <Route path="/ProfileSetup" ele={ProfileSetup} />
      <Navigate to='/ProfileSetup' />
    </Routes>
  )
}

export default PrivateRoute;
